function generateTable(csvData) {
  const lines = csvData.split('\n');
  const table = document.createElement('table');

  // 表のヘッダを作成
  const headerRow = document.createElement('tr');
  const headers = lines[0].split(',');
  for (const header of headers) {
    const th = document.createElement('th');
    th.textContent = header;
    headerRow.appendChild(th);
  }
  table.appendChild(headerRow);

  // 表のデータを作成
  for (let i = 1; i < lines.length-1; i++) {
    const dataRow = document.createElement('tr');
    const data = lines[i].split(',');
    column_num = 0
    for (const value of data) {
      const td = document.createElement('td');
      td.textContent = value;
      if (column_num == 2){
        td.onclick = event => onclickTd(data, event);  // => はアロー関数
        td.style.cursor = "pointer"
      }
      dataRow.appendChild(td);
      column_num += 1
    }
    table.appendChild(dataRow);
  }

  return table;
}

function getSelectedItem() {
  // 選択されたアイテムを取得
  var selectBox = document.getElementById("myList");
  var selectedItem = selectBox.options[selectBox.selectedIndex].value;
  var index = Number(selectedItem)

  // 選択されたアイテムを表示
  const table = generateTable(text[index]);
  tableContainer.innerHTML = '';
  tableContainer.appendChild(table);
}

function onclickTd(data, event){
  var display_text = "順位：" + data[0] + "\nサーバー：" + data[1] + "\n同盟名：" + data[2] + "\nポイント：" + data[3]
  for (const res_data of result_data){
    if ((res_data["name"] == data[2]) && (res_data["server"] == data[1])){
      // display_text += "\n"
      for (const res of res_data["result"]){
        display_text += "\n" + res["result"] + " [" + data[1] + "]" + data[2] + "(" + res["point"] + ")" + " vs [" + res["opp_server"]+ "]" + res["opp_name"] + "(" + res["opp_point"] + ")"
      }
    }
  }
  alert(display_text)
}